import React from "react"

class QuizQuestion extends React.Component {
    render() {
        return (
            <>
                <h5>An otter's den is called a sofa.</h5>
                <button type="button" className="btn btn-primary btn-space">True</button>
                <button type="button" className="btn btn-primary btn-space">False</button>
            </>
        );
    }
}

export default QuizQuestion;
